resource/preparation_work.html.body:
准备工作
TuyaSmartCamera 依赖于涂鸦智能iOS SDK，在接入此SDK时，需要先接入TuyaSmartHomeKit（点击这里查看接入文档）。
在使用Camera的文件顶部，添加以下内容：
#import 

示例代码约定
在以下示例代码中，如果没有特殊说明，所有实例均位于ViewController类的实现文件中
@interface ViewController : UIViewController

@end

@implementation ViewController

// 所有示例代码均位于此处

@end
对于像self.prop这样的引用，我们约定prop属性在ViewController类中已经有了正确的实现。例如：
self.device = [[TuyaSmartDevice alloc] initWithDeviceId:@"your_device_id"];
若想让它正确执行，需要在当前的ViewController类中添加一个 TuyaSmartDevice属性：
@property (nonatomic, strong) TuyaSmartDevice *device;
以此类推。

